import React, { useEffect } from 'react'
const Splitwise = require('splitwise')
const Main = () => {
  const sw = Splitwise({
    consumerKey: '0BQ8KjbxCpgOttRR2ucR55bSBBpre3hHxBogEzNv',
    consumerSecret: 'iWi6eVJBUU2Xs6cb0hnIhDVvMbbWtfAWTZfw7DW4',
  })
  const group_id = '12345678'
  useEffect(() => {
    Promise.all([
      sw.getGroup({ group_id: group_id }),
      sw.getExpenses({ group_id: group_id }),
      sw.getCurrentUser(),
    ])
      .then(([group, expenses, me]) =>
        sw.createDebt({
          from: group.members[0].id,
          to: me.id,
          group_id: group_id,
          description: expenses[0].description,
          amount: 100,
        })
      )
      .then(console.log)
      .catch(console.error)
  }, [])

  return <div>Apple</div>
}

export default Main
